import React from 'react';
import "../../assets/css/ministry.scss";

export default class Ministry extends React.Component {
    render() {
        return (
            <div className="main">
                <div className="container">
                    <div className="main-title">
                        Ministries
                    </div>
                </div>
            </div>
        )
    }
}
